import React, { Component } from 'react';

import Navigation from "./components/Nav";
import Content from "./components/Content";
import { 
  Navbar, 
  Nav, 
  Form, 
  FormControl, 
  Button, 
  DropdownButton, 
  Dropdown, 
  ButtonGroup
} from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';


import './App.css'; 

function App(){
  return (
    <div className="App">
      <Navigation />
      <Content />
    </div>
  )
}
export default App;
